import React, { useState, useEffect } from "react";
import { UseFetch } from "./useFetch";

export default function CustomHooks() {
  const [data, setData] = useState("");
  const productData = UseFetch("https://fakestoreapi.com/products");
  const categoriesData = UseFetch("https://fakestoreapi.com/products/categories");

  useEffect(() => {
    if (productData && categoriesData) {
      setData({ products: productData, categories: categoriesData });
    }
  }, [productData, categoriesData]);

  return (
    <>
      <h1>Custom Hooks</h1>
      <pre>{JSON.stringify(data, null, 2)}</pre>
    </>
  );
}
